import { Navbar } from 'react-bootstrap'

function AppNavbar() {
  return (
    <Navbar bg="primary">
      <Navbar.Brand> <b className="text-white px-3"> INTELLISTOR </b> </Navbar.Brand>
    </Navbar>
  );
}

export default AppNavbar;
